import React from 'react';
import MyComponent from './Add_Tiffin_Center/addTiffinCenter';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

const Router = () => {
  return (
    <BrowserRouter> 
    <Routes>
        <Route path='/' element={<MyComponent />} />
     
      </Routes>
    </BrowserRouter>
  );
};

export default Router;
